        public static bool IsEmpty(string str)
        {
            return str == null || string.Empty.Equals(str);
        }

        /// <summary>
        /// ½ØÈ¡ÖÐÓ¢ÎÄ»ìºÏ×Ö·û´® 
        /// </summary>
        /// <param name="original">Ô­Ê¼×Ö·û´®</param>
        /// <param name="length">Òª½ØÈ¡µÄ³¤¶È</param>
        /// <returns></returns>
        public static string CnCutString(string original, int length)
        {
            Regex CnRegex = new Regex("[\u4e00-\u9fa5]+|[¡°¡± £¬¡£¡¡ ¡¢]", RegexOptions.Compiled);
            char[] CharArray = original.ToCharArray();
            int tmplength = 0;
            for (int i = 0; i < CharArray.Length; i++)
            {
                tmplength += CnRegex.IsMatch(CharArray[i].ToString()) ? 2 : 1;
                if (tmplength > length) return original.Substring(0, i);
            }

            return original;
        }

        public static String ReWriteCode(String code)
        {
            return ReWrite(code.ToCharArray(), code.Length - 1);
        }

        private static String ReWrite(char[] code, int pos)
        {
            for (int i = pos; i >= 0; i--)
            {
                code[i] = GetNextChar(code[i]);//¼Ó1
                if (code[i] != '0') break;  //ÈôÃ»ÓÐ½øÎ»£¬ÔòÁ¢¼´½áÊø¡£
            }
            return new String(code);
        }

        //·µ»Ø10½øÖÆÊý×ÖcµÄÏÂÒ»¸öÊý×Ö
        private static char GetNextChar(char c)
        {
            if (c == '9') return '0';
            return (char)(c + 1);
        }

        public static string GetNextEncodeNumber(int length, string maxEncode)
        {
            string encodeNumber = maxEncode.PadLeft(length, '0');
            encodeNumber = ReWriteCode(encodeNumber);
            return encodeNumber;
        }

        public static string CurtNumber(string oldStr)
        {
            string newStr = "";
            if (oldStr != "0")
            {
                newStr = oldStr.TrimEnd('0');
            }
            else
            {
                return "0";
            }
            int index = newStr.Length - 1;
            if (newStr.LastIndexOf('.') == index)
            {
                newStr = newStr.TrimEnd('.');
            }
            return newStr;
        }

        public static string GetEncodeNumber(string prifix)
        {
            string result = string.Empty;
            string postfix = string.Empty;
            DateTime nowTime = DateTime.Now;
            postfix = nowTime.Year.ToString().Substring(3, 1);
            if (nowTime.Month >= 10)
                postfix += nowTime.Month.ToString();
            else
                postfix += 0 + nowTime.Month.ToString();
            if (nowTime.Day >= 10)
                postfix += nowTime.Day.ToString();
            else
                postfix += 0 + nowTime.Day.ToString();
            if (nowTime.Hour >= 10)
                postfix += nowTime.Hour.ToString();
            else
                postfix += 0 + nowTime.Hour.ToString();
            if (nowTime.Minute >= 10)
                postfix += nowTime.Minute.ToString();
            else
                postfix += 0 + nowTime.Minute.ToString();
            if (nowTime.Second >= 10)
                postfix += nowTime.Second.ToString();
            else
                postfix += 0 + nowTime.Second.ToString();
            if (nowTime.Millisecond >= 100)
            {
                postfix += nowTime.Millisecond.ToString();
            }
            else if (nowTime.Millisecond >= 10 && nowTime.Millisecond < 100)
            {
                postfix += 0 + nowTime.Millisecond.ToString();
            }
            else if (nowTime.Millisecond < 10)
            {
                postfix += 00 + nowTime.Millisecond.ToString();
            }

            result = prifix + postfix;

            if (prifix=="YD" && OrderDetailOperation.CheckEncodeExist(result))
            {
                result = GetEncodeNumber(prifix);
            }
            return result;
        }

