        /// <summary> 
        /// »ñµÃÒ»¸ö×Ö·û´®µÄººÓïÆ´ÒôÂë 
        /// </summary> 
        /// <param name="strText">×Ö·û´®</param> 
        /// <returns>ººÓïÆ´ÒôÂë,¸Ã×Ö·û´®Ö»°üº¬´óÐ´µÄÓ¢ÎÄ×ÖÄ¸</returns> 
        public static string GetChineseSpell(string strText)
        {
            if (strText == null || strText.Length == 0)
                return strText;
            System.Text.StringBuilder myStr = new System.Text.StringBuilder();
            foreach (char vChar in strText)
            {
                // ÈôÊÇ×ÖÄ¸ÔòÖ±½ÓÊä³ö 
                if ((vChar >= 'a' && vChar <= 'z') || (vChar >= 'A' && vChar <= 'Z'))
                    myStr.Append(char.ToUpper(vChar));
                else if ((int)vChar >= 19968 && (int)vChar <= 40869)
                {
                    // Èô×Ö·ûUnicode±àÂëÔÚ±àÂë·¶Î§Ôò ²éºº×ÖÁÐ±í½øÐÐ×ª»»Êä³ö 
                    foreach (string strList in strChineseCharList)
                    {
                        if (strList.IndexOf(vChar) > 0)
                        {
                            myStr.Append(strList[0]);
                            break;
                        }
                    }
                }
            }
            return myStr.ToString();
        }
    }
